 <img src={"/upload/"+currentUser.profilepic} alt="picture" className='userpic' />
 <span>{currentUser.name}</span>
</div>
</Link>

<div >
<PeopleIcon />
<span>friends</span>
</div>

<div>
<img src='upload'/>
<span>saved</span>
</div>

<div onClick={()=>setShowInfo(!showInfo)}>
<InfoIcon />
<span>Info</span>
</div>



</div>

      </div>
    </div>



  )
}

export default Leftbar
